import * as React from "react";
import { Image } from "expo-image";
import { StyleSheet, View, Text, Pressable } from "react-native";
import { useNavigation } from "@react-navigation/native";
import { Border, Color, FontFamily, FontSize } from "../GlobalStyles";

const AndroidSmall3 = () => {
  const navigation = useNavigation();

  return (
    <View style={styles.androidSmall3}>
      <Image
        style={[styles.androidSmall3Child, styles.androidPosition]}
        contentFit="cover"
        source={require("../assets/ellipse-21.png")}
      />
      <Image
        style={[styles.androidSmall3Item, styles.androidPosition]}
        contentFit="cover"
        source={require("../assets/vector-6.png")}
      />
      <Image
        style={styles.androidSmall3Inner}
        contentFit="cover"
        source={require("../assets/ellipse-16.png")}
      />
      <Image
        style={styles.undrawMaleAvatarG98d1Icon}
        contentFit="cover"
        source={require("../assets/undraw-male-avatar-g98d-1.png")}
      />
      <View style={[styles.rectangleView, styles.rectangleChildLayout]} />
      <View style={[styles.androidSmall3Child1, styles.rectangleChildLayout]} />
      <View style={[styles.androidSmall3Child1, styles.rectangleChildLayout]} />
      <View style={[styles.androidSmall3Child3, styles.rectangleChildLayout]} />
      <View style={[styles.androidSmall3Child3, styles.rectangleChildLayout]} />
      <Text style={[styles.enterProductName, styles.productFlexBox]}>
        enter product name
      </Text>
      <Text
        style={[styles.enterProductDescription, styles.productFlexBox]}
      >{`enter product description `}</Text>
      <Text
        style={[styles.enterProductQuantity, styles.productFlexBox]}
      >{`enter product quantity `}</Text>
      <View style={[styles.androidSmall3Child5, styles.rectangleChildLayout]} />
      <View style={[styles.androidSmall3Child5, styles.rectangleChildLayout]} />
      <Text
        style={[styles.enterProductPrice, styles.productFlexBox]}
      >{`enter product price `}</Text>
      <Text style={[styles.productImage, styles.productFlexBox]}>
        product image
      </Text>
      <Pressable
        style={[styles.rectanglePressable, styles.rectangleChildLayout]}
        onPress={() => navigation.navigate("AndroidSmall4")}
      />
      <Text style={[styles.submit, styles.productFlexBox]}>Submit</Text>
    </View>
  );
};

const styles = StyleSheet.create({
  androidPosition: {
    left: 0,
    position: "absolute",
  },
  rectangleChildLayout: {
    height: 57,
    width: 330,
    borderRadius: Border.br_8xs,
    left: 15,
    position: "absolute",
  },
  productFlexBox: {
    textAlign: "left",
    position: "absolute",
  },
  androidSmall3Child: {
    top: 0,
    width: 207,
    height: 207,
  },
  androidSmall3Item: {
    top: 522,
    width: 420,
    height: 118,
  },
  androidSmall3Inner: {
    top: 27,
    left: 189,
    width: 120,
    height: 120,
    position: "absolute",
  },
  undrawMaleAvatarG98d1Icon: {
    top: 32,
    left: 194,
    width: 110,
    height: 110,
    position: "absolute",
    overflow: "hidden",
  },
  rectangleView: {
    top: 217,
    borderWidth: 1,
    borderColor: "#887e7e",
    borderStyle: "solid",
    width: 330,
    borderRadius: Border.br_8xs,
    left: 15,
  },
  androidSmall3Child1: {
